import CalculateHandler from "./CalculateHandler";

const ResultTable = (props) => {
    return (
        <table className="result">
            <thead>
                <tr>
                    <th>Year</th>
                    <th>Total Savings</th>
                    <th>Interest (Year)</th>
                    <th>Total Interest</th>
                    <th>Invested Capital</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <CalculateHandler input={props.input}/>
                </tr>
            </tbody>
        </table>
    );
};

export default ResultTable;
